    private async void OnChangeTickers()
    {
        if (val != null && val.Length != 0)
        {
            try
            {
                tickers = await Http.GetFromJsonAsync<TickerSearch[]>($"/tickers/{val}");
            }
            catch(Exception e)
            {
                OnChangeTickers();
            }
        }
    }

